name: Convert OpenVPN client key to DES3 for Android or iOS clients

Answer: command: openssl rsa -in /etc/openvpn/certs/INDIGOVR-{{ INDIGOVR_NODE_TYPE }}-{{ ansible_fqdn
  }}.key -out /etc/openvpn/certs/INDIGOVR-{{ INDIGOVR_NODE_TYPE }}-{{ ansible_fqdn
  }}.key.des3 -passout file:/etc/openvpn/passphrase.txt -pubout -out /etc/openvpn/certs/INDIGOVR-{{
  INDIGOVR_NODE_TYPE }}-{{ ansible_fqdn }}.key.pub
when: openvpn_client_des3

